import React, { Component } from 'react';

class DeleteExamForm extends Component {
    constructor(props) {
        super(props)
        this.state = {
            patientID: "",
        }
        this.handleOnSubmit = this.handleOnSubmit.bind(this);
    }

    handleOnSubmit = (e) => {
        this.fetching();
    }

    async fetching() {
        const options = {

            method: "DELETE",

        }

        await fetch(`http://localhost:3001/exams/${this.state.patientID}`, options)
        .then(response => response.text())
        .catch(error => console.log('error', error)); 
    }

    render () {
        return (
            <div> 
            <label> Please Enter Exam ID to be deleted</label>
            <input type="text" required={true} 
                    onChange={(e) => this.setState({ patientID: e.target.value })} />
            <br /><br />
            <button id='addBtn' type="submit"
                    value="submit" onClick={this.handleOnSubmit}>Submit</button>
            </div>
        )
    }

}

export default DeleteExamForm;
